let list = [
    {
        id: 1,
        question: "당신이 좋아하는 아이스크림은?",
        option1: "더위사냥",
        option2: "보석바"
    },
    {
        id: 2,
        question: "당신이 좋아하는 드라마는?",
        option1: "꽃보다 남자",
        option2: "킬미힐미"
    },
    {
        id: 3,
        question: "당신이 좋아하는 음료수는?",
        option1: "코카콜라",
        option2: "펩시"
    },
];

export function getLists() {
    return list;
}

export function getList(id) {
    return list.find((list) => list.id === id);
}
